/**
 * 思路：
 * 　　找字符上一次出现的位置，以及 以位置ｉ为开头的字符串的长度
 *    双重循环　ｉ，ｊ，以及 ｊ处字符上次出现的位置p[s[j]], 对这三个值考虑
 */

#include <cstdio>
#include <string>
#include <vector>
#include <set>
#include <algorithm>
#include <iostream>
#include <cstring>

using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s)
    {
        if (s.length() == 0) {
            return 0;
        }

        int p[128]; //p[c]: 表示字符ｃ上一次出现的位置
        for (int i = 0; i < 128; ++i)
            p[i] = -1;

        vector<int> len(s.size(), 1);  //len[i]表示以ｉ处开头的字符串的长度
        int maxlen = 1;

        for (int i = 0; i < s.size(); ++i) {
            if (s.size() - i < maxlen)
                break;

            p[s[i]] = i;
            int next = -1; //直接跳的位置

            for (int j = i+1; j < s.size(); ++j) {

                if (p[s[j]] == -1 || p[s[j]] < i) {
                    len[i]++;
                    maxlen = max(maxlen, len[i]);
                    p[s[j]] = j;
                    continue;
                }

                if (p[s[j]] >= i) {
                    len[i] = j - i;
                    maxlen = max(maxlen, len[i]);
                    //可以直接跳到p[s[j]]处
                    next = p[s[j]];
                    break;
                }
            }
            if (next != -1) {
                i = next;
            }
            //对p数组重新设置
            memset(p, -1, 128*sizeof(int));
        }
        return maxlen;
    }
};


